import React from 'react'
import './App.css';
import image from './image/1.jpg'
import Login from './components/login';
class App extends React.Component {

  render() {

    return (
      <div className="App">
        <div className="container">
          <div id="image">
            <img className="img-fluid" src={image} />

          </div>
          <Login />

        </div>
      </div>
    );
  }
};


export default App;
